// src/components/TabelaOrdensServico.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import '../styles/OrdensServico.css';

const TabelaOrdensServico = () => {
  const [ordens, setOrdens] = useState([]);
  const [statusFilter, setStatusFilter] = useState('');
  const [tipoVisitaFilter, setTipoVisitaFilter] = useState('');
  const [modalidadeFilter, setModalidadeFilter] = useState('');

  useEffect(() => {
    setOrdens([
      {
        id: 1,
        numero_protocolo: 'PROTOCOLO123',
        nome_empresa: 'Hospital Santa Clara',
        tipo_visita: 'Técnico',
        modalidade: 'Presencial',
        status: 'Aguardando Atendimento',
        nome_tecnico: 'Carlos Souza',
        data_abertura: '2025-05-05',
        data_agendamento: '2025-05-10',
        equipamento: 'Monitor de sinais vitais DX200',
      }
    ]);
  }, []);

  const handleFilter = () => {
    console.log('Filtrando ordens por:', statusFilter, tipoVisitaFilter, modalidadeFilter);
  };

  return (
    <div>
      <div style={{ marginBottom: '20px' }}>
        <select value={statusFilter} onChange={(e) => setStatusFilter(e.target.value)}>
          <option value="">Filtrar por Status</option>
          <option value="Aguardando Atendimento">Aguardando Atendimento</option>
          <option value="Em Pendencia">Em Pendência</option>
          <option value="Realizado Em Validação">Realizado Em Validação</option>
          <option value="Finalizado">Finalizado</option>
          <option value="Atrasado">Atrasado</option>
        </select>

        <select value={tipoVisitaFilter} onChange={(e) => setTipoVisitaFilter(e.target.value)} style={{ marginLeft: '10px' }}>
          <option value="">Filtrar por Tipo de Visita</option>
          <option value="Técnico">Técnico</option>
          <option value="Científico">Científico</option>
        </select>

        <select value={modalidadeFilter} onChange={(e) => setModalidadeFilter(e.target.value)} style={{ marginLeft: '10px' }}>
          <option value="">Filtrar por Modalidade</option>
          <option value="Presencial">Presencial</option>
          <option value="Remoto">Remoto</option>
        </select>

        <button onClick={handleFilter} style={{ marginLeft: '10px' }}>Aplicar Filtros</button>
      </div>

      <table border="1" cellPadding="8" width="100%">
        <thead>
          <tr>
            <th>ID</th>
            <th>Protocolo</th>
            <th>Empresa</th>
            <th>Técnico</th>
            <th>Visita</th>
            <th>Modalidade</th>
            <th>Status</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {ordens.map((ordem) => (
            <tr key={ordem.id}>
              <td>{ordem.id}</td>
              <td>{ordem.numero_protocolo}</td>
              <td>{ordem.nome_empresa}</td>
              <td>{ordem.nome_tecnico}</td>
              <td>{ordem.tipo_visita}</td>
              <td>{ordem.modalidade}</td>
              <td>{ordem.status}</td>
              <td>
                <Link to={`/ordem-servico/${ordem.id}`}><button>Validar</button></Link>
                <Link to={`/editar/${ordem.id}`}><button>Atender OS</button></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TabelaOrdensServico;
